import React, {Component} from 'react';
import axios from 'axios';
import stockitems from '../../stockitemmodels/stockitems';

export default class App extends Component{

  constructor(props){
    super(props);

    this.state={
      stockitems:[]
    };

  }


  componentDidMount(){
    this.retrieveStockItems();
  }


  retrieveStockItems(){
    axios.get("http://localhost:2050/stockitems").then(res=>{
      if(res.data.success){
        this.setState({
          stockitems:res.data.existingStockitems
        });
        console.log(this.state.stockitems)
      }
    });
  }
  render(){
    return(
      <div>
         {this.state.stockitems.map(stockitems=>(
           <div>
             <p>{stockitems.stockitemId}</p>
             <p>{stockitems.stockitemName}</p>
             <p>{stockitems.stockitemQty}</p>
             <p>{stockitems.stockitemType}</p>
             <p>{stockitems.stockitemunitPrice}</p>
             <p>{stockitems.itemaddedDate}</p>
             <p>{stockitems.supplierId}</p>
             <p>{stockitems.orderNo}</p>

           </div>
         ))}
      </div>
    )
  }
}
